import './index.css'

const Header = function () {
    return (
        <div>
            <h1>Header Bar</h1>
            <div className='icon'>
            <i class="fa-solid fa-address-card fa-2x"></i>
            </div>

            <div className='icon'>
            <i class="fas fa-tools fa-2x"></i>
            </div>
        </div>
    )
}

export default Header ;
